:17.000','Να σε πάρει, να, να πάτε εκεί, και το βράδυ τα μεσάνυχτα θα ρθούμε, να μπούμε, να φύγουμε, να πάμε στο εξωτερικό.» ','0','0000-00-00 00:00:00','0000-00-00 00:00:00',8.00,0,0,'',0,0,'0',28),(2434,46,46,'rsc35_rsc167_46.mp4?vbegin=2845&vend=2855','00:47:25.000','«Ποιοι θα είσαστε;» «Θα είμαι εγώ, ο Μπαντουβάς, ο Γιώργος ο Βολουδάκης, που ήτανε βουλευτής Χανίων, ','0','0000-00-00 00:00:00','0000-00-00 00:00:00',10.00,0,0,'',0,0,'0',28),(2435,46,46,'rsc35_rsc167_46.mp4?vbegin=2855&vend=2858','00:47:35.000','και ο Μανώλης ο Κεφαλογιάννης.»','0','0000-00-00 00:00:00','0000-00-00 00:00:00',3.00,0,0,'',0,0,'0',28),(2436,46,46,'rsc35_rsc167_46.mp4?vbegin=2858&vend=2865','00:47:38.000',' Κατέβηκα εγώ στις δύο η ώρα κάτω, αφού είπα στη γυναίκα μου ότι πάω στο Ηράκλειο, ','0','0000-00-00 00:00:00','0000-00-00 00:00:00',7.00,0,0,'',0,0,'0',28),(2437,46,46,'rsc35_rsc167_46.mp4?vbegin=2865&vend=2868','00:47:45.000','δεν είπα ότι πάω στο εξωτερικό, ότι πάω στο Ηράκλειο, ','0','0000-00-00 00:00:00','0000-00-00 00:00:00',3.00,0,0,'',0,0,'0',28),(2438,46,46,'rsc35_rsc167_46.mp4?vbegin=2868&vend=2874','00:47:48.000','και μ_, για δυο τρεις μέρες, και μου ετοίμασε ένα βαλιτσάκι με κανά δυο κάλτσες και εσώρουχα,','0','0000-00-00 00:00:00','0000-00-00 00:00:00',6.00,0,0,'',0,0,'0',28),(2439,46,46,'rsc35_rsc167_46.mp4?vbegin=2874&vend=2877','00:47:54.000',' Κατέβηκα κάτω και τα_, κατά τα μεσάνυχτα ','0','0000-00-00 00:00:00','0000-00-00 00:00:00',3.00,0,0,'',0,0,'0',28),(2440,46,46,'rsc35_rsc167_46.mp4?vbegin=2877&vend=2882','00:47:57.000','κατέφθασε ο Νικήτας ο Βενιζέλος με τον Μπαντουβά, τον Κώστα τον Μπαντουβά,','0','0000-00-00 00:00:00','0000-00-00 00:00:00',5.00,0,0,'',0,0,'0',28),(2441,46,46,'rsc35_rsc167_46.mp4?vbegin=2882&vend=2886','00:48:02.000',' τον Γιώργο το Βολουδάκη. Όχι_, δεν ήτανε ο Κεφαλογιάννης.','0','0000-00-00 00:00:00','0000-00-00 00:00:00',4.00,0,0,'',0,0,'0',28),(2442,46,46,'rsc35_rsc167_46.mp4?vbegin=2886&vend=2888','00:48:06.000','Και λέω: «Πού είναι ο Κεφαλογιάννης;» ','0','0000-00-00 00:00:00','0000-00-00 00:00:00',2.00,0,0,'',0,0,'0',28),(2443,46,46,'rsc35_rsc167_46.mp4?vbegin=2888&vend=2893','00:48:08.000','Λέει: «Θα έρθει να μας βρει, γιατί είχε κάποια δουλειά, θα έρθει να μας βρει στην Πάτρα. ','0','0000-00-00 00:00:00','0000-00-00 00:00:00',5.00,0,0,'',0,0,'0',28),(2444,46,46,'rsc35_rsc167_46.mp4?vbegin=2893&vend=2896','00:48:13.000','Θα είναι αύριο» λέει «το βράδυ στου Κώστα», ','0','0000-00-00 00:00:00','0000-00-00 00:00:00',3.00,0,0,'',0,0,'0',28),(2445,46,46,'rsc35_rsc167_46.mp4?vbegin=2896&vend=2904','00:48:16.000','του Κωστή του Στεφανόπουλου, του άλλοτ_, του μετά ταύτα Προέδρου της Δημοκρατίας, «το γραφείο.»','0','0000-00-00 00:00:00','0000-00-00 00:00:00',8.00,0,0,'',0,0,'0',28),(2446,46,46,'rsc35_rsc167_46.mp4?vbegin=2904&vend=2911','00:48:24.000','Αποπλεύσαμε. Φτάσαμε την άλλη μέρα το πρωί στα Τριζόνια, ','0','0000-00-00 00:00:00','0000-00-00 00:00:00',7.00,0,0,'',0,0,'0',28),(2447,46,46,'rsc35_rsc167_46.mp4?vbegin=2911&vend=2917','00:48:31.000','Τριζόνια είναι η κα_, μια νησίδα, μια συστάς νησίδων απέναντι από το Γαλαξίδι. ','0','0000-00-00 00:00:00','0000-00-00 00:00:00',6.00,0,0,'',0,0,'0',28),(2448,46,46,'rsc35_rsc167_46.mp4?vbegin=2917&vend=2923','00:48:37.000','Εκεί μπήκαμε σ\' έναν ορμίσκο και μείναμε, για να νυχτώσει. ','0','0000-00-00 00:00:00','0000-00-00 00:00:00',6.00,0,0,'',0,0,'0',28),(2449,46,46,'rsc35_rsc167_46.mp4?vbegin=2923&vend=2932','00:48:43.000','Κατά τις δέκα η ώρα καταφθάνουν κάτι αεροπλάνα καταδιώξεως δικά μας και κάνανε καθέτους εφορμήσεις.','0','0000-00-00 00:00:00','0000-00-00 00:00:00',9.00,0,0,'',0,0,'0',28),(2450,46,46,'rsc35_rsc167_46.mp4?vbegin=2932&vend=2939','00:48:52.000','Μπορώ να πω, ότι οι υπόλοιποι λαχτάρησαν λιγάκι [χαμογελάει ελαφρώς]. ','0','0000-00-00 00:00:00','0000-00-00 00:00:00',7.00,0,0,'',0,0,'0',28),(2451,46,46,'rsc35_rsc167_46.mp4?vbegin=2939&vend=2946','00:48:59.000','Κάνανε γυμνάσια, δεν κυνηγούσαν εμάς. Ύστερα φύγαμε, το βραδάκι.','0','0000-00-